import React from "react";
import { Link } from "react-router-dom";


const Home = () => {
    return (
        <>
        <header>
            <a href="#">Logo</a>
            <nav>
              <ul>
              <li>
                <Link to="/">Home</Link>
                </li>
                <li>
                <Link to>About</Link>
                </li>
                <li>
                <Link>Contact</Link>
                </li>

              </ul>  
            </nav>
        </header>
        </>
    );
    
};

export default Home;
